import './scss/blocks/style.scss';

const dataItems = [
  {name: 'item'},
  {name: 'item'},
  {name: 'item'},
  {name: 'item'}
]

function App() {

  const items = dataItems.map((item, i) => {
  return <p className={`${item.name}-${i + 1}`} key={i}>{`${item.name} ${i + 1}`}</p>
  })

  return (
    <div className="App">
      <div className="container">
        {items}
      </div>
    </div>
  );
}

export default App;
